import React, { useState } from 'react';
import googleLogo from '../assets/images/google.png';

// Simplified component names like in React Native or React Native Web
const View = ({ style, children }) => <div style={style}>{children}</div>;
const Text = ({ style, children }) => <p style={style}>{children}</p>;
const Button = ({ onClick, style, children }) => (
  <button onClick={onClick} style={style}>{children}</button>
);
const TextInput = ({ value, onChange, style, placeholder, type = 'text' }) => (
  <input
    type={type}
    value={value}
    onChange={onChange}
    style={style}
    placeholder={placeholder}
  />
);

const LoginPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = (e) => {
    e.preventDefault();
    console.log('Login attempt with:', { username, password });
  };

  const styles = {
    container: {
      display: 'flex',
      flexDirection: 'column',
      width: '100vw',
      height: '100vh',
      backgroundColor: '#E5E5E5',
    },
    headerBar: {
      backgroundColor: '#2c2c42',
      color: '#fff',
      padding: '10px',
      textAlign: 'center',
      fontSize: '20px',
      width: '100%',
      position: 'fixed',
      top: 0,
      left: 0,
      zIndex: 1000, // Ensures the header is above other elements
    },
    leftContainer: {
      flex: 2,
      padding: '50px',
      paddingTop: '60px', // Added padding to accommodate fixed header
      backgroundColor: '#f5f5f5',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
    },
    logo: {
      width: '150px',
      marginBottom: '30px',
    },
    title: {
      fontSize: '28px',
      fontWeight: 'bold',
      marginBottom: '30px',
    },
    googleButton: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#fff',
      padding: '10px 20px',
      borderRadius: '5px',
      boxShadow: '0px 4px 6px rgba(0, 0, 0, 0.1)',
      marginBottom: '20px',
      cursor: 'pointer',
    },
    googleIcon: {
      width: '20px',
      marginRight: '10px',
    },
    divider: {
      display: 'flex',
      alignItems: 'center',
      marginBottom: '20px',
    },
    line: {
      flex: 1,
      height: '1px',
      backgroundColor: '#000',
    },
    form: {
      width: '100%',
      maxWidth: '400px',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    },
    label: {
      marginBottom: '5px',
      fontWeight: 'bold',
    },
    input: {
      width: '100%',
      padding: '10px',
      marginBottom: '20px',
      borderRadius: '5px',
      border: '1px solid #ccc',
    },
    loginButton: {
      padding: '10px 20px',
      backgroundColor: '#000',
      color: '#fff',
      border: 'none',
      borderRadius: '5px',
      cursor: 'pointer',
      width: '100%',
    },
    rightContainer: {
      flex: 1,
      backgroundColor: '#2c2c42',
      color: '#fff',
      padding: '50px',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
    },
    newHereTitle: {
      fontSize: '28px',
      fontWeight: 'bold',
      marginBottom: '10px',
    },
    newHereText: {
      marginBottom: '20px',
    },
    signInButton: {
      padding: '10px 20px',
      backgroundColor: '#fff',
      color: '#000',
      border: 'none',
      borderRadius: '5px',
      cursor: 'pointer',
    },
  };

  return (
    <View style={styles.container}>
      {/* Header Bar */}
      <View style={styles.headerBar}>
        <Text>My Application</Text>
      </View>

      {/* Left Section */}
      <View style={styles.leftContainer}>
        <img src={googleLogo} alt="Logo" style={styles.logo} />
        <Text style={styles.title}>Login to your Account</Text>
        <View style={styles.googleButton}>
          <img src={googleLogo} alt="Google" style={styles.googleIcon} />
          <Text>Login using Google</Text>
        </View>
        <View style={styles.divider}>
          <hr style={styles.line} /> OR <hr style={styles.line} />
        </View>
        <View as="form" onSubmit={handleLogin} style={styles.form}>
          <Text style={styles.label}>ENTER USERNAME</Text>
          <TextInput
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            style={styles.input}
            placeholder="Username"
          />
          <Text style={styles.label}>ENTER PASSWORD</Text>
          <TextInput
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={styles.input}
            placeholder="Password"
          />
          <Button type="submit" style={styles.loginButton}>LOGIN</Button>
        </View>
      </View>

      {/* Right Section */}
      <View style={styles.rightContainer}>
        <Text style={styles.newHereTitle}>NEW HERE?</Text>
        <Text style={styles.newHereText}>Sign in and discover more</Text>
        <Button style={styles.signInButton}>SIGN IN</Button>
      </View>
    </View>
  );
};

export default LoginPage;
